        [color=#009100]      [head=3]Nanotrasen Memo[/head]

              Rules[/color]

        

        -Players put money into a pool split between the winners before match start, HOP may be contacted to provide addtional funds for a higher pot.

        - Games must be started and monitered by a Security officer.

        - All players start by their team flag.

        - 3 vs 3 (Equipment for each player is provided).

        - Start game by pressing desk button.

        - 5 hits and a player is Out, players must moniter their own hit count.

        - Player holds lit lantern to signal being Out and must go to their teams timeout zone in the central Brig.

        - NO shooting at out players

        - Time out lasts 1 minute, players should set their own timer in the Brig.

        - Players returning from the Brig must not shoot until they leave the zone fully.

        - Objective is to capture the enemy teams flag.

        - If you have the flag it must be in hand.

        - Out players must drop the flag before proceeding to the Brig.


